import express from '../images/image-express.jpg'
import transfer from '../images/image-transfer.jpg' 
import photon from '../images/image-photon.jpg'
import builder from '../images/image-builder.jpg'
import blogr from '../images/image-blogr.jpg'

const webDesignProjects = [

    {
      id: 'express',
      title: 'express',
      img: `${express}`,
      description: 'A multi-carrier shipping website for ecommerce businesses',
    },
    {
      id: 'transfer',
      title: 'transfer',
      img: `${transfer}`,
      description:
        'Site for low-cost money transfers and sending money within seconds',
    },
    // {
    //   id: 'photon',
    //   title: `${photon}`,
    
    //   description:
    //     'A state-of-the-art music player with high-resolution audio and DSP effects',
    // },
    {
      id: 'builder',
      title: 'builder',
      img: `${builder}`,
      description:
        'Connects users with local contractors based on their location',
    },
    {
      id: 'blogr',
      title: 'blogr',
      img: `${blogr}`,
      description:
        'Blogr is a platform for creating an online blog or publication',
    },
    {
      id: 'camp',
      title: 'camp',
      img: './image-camp.jpg',
      description:
        'Get expert training in coding, data, design, and digital marketing',
    },
  ];
  
  export default webDesignProjects;
